import React from 'react';

const MatrixTable = () => {
  // Sample data representing class names and corresponding field values
  const matrixData = [
    {
      className: 'Payment',
      fields: [
        { name: 'Field 1', value: 'Value 1' },
        { name: 'Field 2', value: 'Value 2' },
        { name: 'Field 3', value: 'Value 3' }
      ]
    },
    {
      className: 'Class 2',
      fields: [
        { name: 'Field 1', value: 'Value 4' },
        { name: 'Field 2', value: 'Value 5' },
        { name: 'Field 3', value: 'Value 6' }
      ]
    },
    {
      className: 'Class 3',
      fields: [
        { name: 'Field 1', value: 'Value 7' },
        { name: 'Field 2', value: 'Value 8' },
        { name: 'Field 3', value: 'Value 9' }
      ]
    }
  ];

  return (
    <table border="1">
      <thead>
        <tr>
          <th>Class Name</th>
          {matrixData[0].fields.map((field, index) => (
            <th key={index}>{field.name}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {matrixData.map((rowData, idx) => (
          <tr key={idx}>
            <td>{rowData.className}</td>
            {rowData.fields.map((field, index) => (
              <td key={index}>{field.value}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default MatrixTable;
